import React from 'react'
import './Struktur.css'
import image1 from '../image/Banner1.jpeg'
import image2 from '../image/Banner2.jpg'
import image3 from '../image/Banner3.jpg'
import image4 from '../image/Banner4.jpg'

const DataImage = [
    {
        "Image": image1,
        "Title": "Gambar1"
    },
    {
        "Image": image2,
        "Title": "Gambar2"
    },
    {
        "Image": image3,
        "Title": "Gambar3"
    },
    {
        "Image": image4,
        "Title": "Gambar4"
    },
    {
        "Image": image2,
        "Title": "Gambar4"
    }, 
    {
        "Image": image1,
        "Title": "Gambar4"
    },
    {
